import React from 'react';
import './Test.css';

function Test() {
    return (
        <div>
        <header>
            {/* <a id="logo"><img class="clickable" style="opacity: 1;" src="css/src/bdd_circle.png"/></a> */}
            <nav>
                <a class="unselected clickable"/>
                <a class="unselected clickable"/>
            </nav>
        </header>

        <div id="container-new" style={{marginTop: 14 + '%'}}>
            <h1 data-sr="enter right move 50px wait 0.1s" class="titles"><a class="titles clickable">BRANDON DAVID</a></h1>
            <h2 data-sr="enter right move 50px wait 0.2s" class="blurbs">
                Aspiring <orange>developer</orange> and <orange>designer.</orange><br/>
                Rising third-year at UC Berkeley.<br/>
                Electrical Engineering and Computer Science. <br/>
            </h2>
            <h2 data-sr="enter right move 50px wait 0.3s" class="blurbs">
                <div class="action-link"><a class="pastworks clickable">Check out some of my past works.</a></div>
            </h2>
        </div>
        {/* <script src="js/scrollReveal.js"></script>
        <script>
            window.sr = new scrollReveal({
                mobile: true
            });   
        </script> */}
        </div>
    );
}

export default Test;
